import React from 'react';
import { InputGroup, FormControl } from 'react-bootstrap';

const Contact = () => {
    return (
        <>
         <InputGroup size="sm" className="mb-3">
    <InputGroup.Prepend>
      <InputGroup.Text id="inputGroup-sizing-sm">Small</InputGroup.Text>
    </InputGroup.Prepend>
    
  </InputGroup>
        </>
    )
}

export default Contact
